int main(int _argc, char** _argv) {
    QApplication lApp(_argc, _argv);
    GLoginUi lWindow;
    GApp lAppI;
    lAppI.loadFonts();
    lAppI.loadStyles();
    lWindow.show();
    return lApp.exec();
}
//===============================================
// GApp.cpp
//===============================================
bool GApp::loadStyles() {
    QFile lFile(":/css/styles.css");
    if(!lFile.open(QIODevice::ReadOnly | QIODevice::Text)) return false;
    QTextStream lStream(&amp;lFile);
    qApp-&gt;setStyleSheet(lStream.readAll());
    return true;
}
//===============================================
bool GApp::loadFonts() {
    QFontDatabase::addApplicationFont(":/font/Raleway-SemiBold.ttf");
    QFontDatabase::addApplicationFont(":/font/Raleway-Light.ttf");
    QFontDatabase::addApplicationFont(":/font/Montserrat-Regular.otf");
    QFontDatabase::addApplicationFont(":/font/Montserrat-Light.otf");
    return true;
}
